INSERT INTO `sma_manpower_requisition` (`id`, `requisition_date`, `position`, `company_id`, `department`, `designation_id`, `workstation`, `organization_type`, `corporate_name`, `business_name`, `number_required`, `exp_min`, `exp_max`, `age_min`, `age_max`, `ap`, `rr`, `rt`, `rp`, `rtr`, `mb_year`, `time_limit`, `reason_ap`, `education`, `skill`, `nature_experience`, `areas_of_responsibility`, `reporting_to`, `no_of_reportees`, `other_info`, `created_by`, `updated_by`, `updated_date`, `created_date`, `status`, `last_approved_by`, `next_approve_seq`, `approved`, `gender`, `requisition_reason`, `category_id`) VALUES
(18, '2019-02-06', 'Associate', 41, 'Information Technology', '490', 'Head Office', 'Corporate', 'Head Office', 'Feed', 1, '3', '7', '25', '35', 0, 1, 0, 0, 0, '2019', '28', 'NA', 'BSC in CSC or BBA(MIS)', 'ERP Implementation', 'Implementation', '<ul>\r\n</ul><ul>\r\n<li>ERP Implementation</li><li>Requirement Analysis & Compile with Logic</li><li>Advance MS Excel</li><li>Knowledge in General Accounting & Finance</li><li>Project Documentation</li><li>Data Analysis</li></ul>', 'Md. Akhtarul Islam Ranis', '6', '', 20, 18, '2019-03-28 07:40:06', '2019-02-07 03:38:39', 'Approved', NULL, 0, 1, 'Male', NULL, 665),
(19, '2019-02-20', 'Associate', 24, 'Production', '357', 'Kapasia, Gazipur', 'Business', '', 'Poultry', 1, '1', '4', '24', '34', 1, 0, 0, 0, 0, '2019', '01/03/2019', 'New Machine Setup in Hatchery', 'H.S.C', 'Leadership, Good communication, Proactive, Good time management, Good initiative', 'Poultry Farm', '<p>01.Egg pick-up and deliveries, care, incubation and hatching, grading, vaccination, preparation and shipping of chicks.</p><p>02.Manage and maintain weekly hatch schedules providing proper number of birds to processing plant.</p><p>03.Manage chick care, maintenance, packing and transfer activities.</p><p>04.Monitor and manage facility equipment and repairs, addressing maintenance issues.</p><p>05.Controls cost in labor,\r\n     repairs, supplies, and vaccines.</p><p>06.Prepares monthly reports and\r\n     graphs on hatchery performance.</p><p>07.Reports egg fertility and\r\n     hatching residue results, as needed, to breeder department.</p><p>08.Consult with company\r\n     veterinarian before making changes.</p><p>09. Maintain Bio-Security in Farm</p><p>10.Prepares employee schedules,\r\n     approves vacation requests, and hires new employees as needed.</p>', 'Dr. Md. Alif Nur', '10', '', 21, 18, '2019-03-28 07:40:06', '2019-02-10 22:07:40', 'Approved', NULL, 0, 1, 'Male', NULL, 665),
(20, '2019-02-20', 'Associate', 26, 'Production', '357', 'Memberbari, Gazipur', 'Business', '', 'Poultry', 2, '1', '10', '20', '35', 1, 0, 0, 0, 0, '2019', '01/03/2019', 'Increased Flock No. PCL 4 & Increase the production of 90000 eggs', 'H.S.C', 'Strong communication, Good time management, Ability to work under pressure, Good initiative,  Leadership', 'Poultry Farm', '<p>01.Maintain Proper Bio-security.</p><p>02.Supervision of Brooding and Vaccination System.</p><p>03.Monitor Egg Collection Properly.</p><p>04.Check Everyday Feeding Water System, Condition of Birds, Regular House Cleaning etc.</p><p>05.Monitor Working Procedure of workers with Safety and all other task Assigned by Management.</p><p>06.Directs maintenance and repair of facilities and equipment, such as\r\nchicken houses, automatic feeders, and layer nests.</p><p>07.Assigns workers to duties, such as collecting\r\nand candling eggs, feeding and vaccinating poultry, crating and shipping\r\nfryers, and cleaning and fumigating chicken houses.</p><p>08.Prepares worker\r\nattendance, egg production, feed consumption, and poultry mortality reports.</p><p>09. Managing and Motivating a team, Ensuring welfare of livestock</p><p>10. Ventilation & Feed Management.</p>', 'Dr. Md. Zahidul Islam', '10', '<p>One Position Replacement Due To Resignation of Md. Shah Jalal</p>', 21, 18, '2019-03-28 07:40:06', '2019-02-10 22:52:57', 'Approved', NULL, 0, 1, 'Male', NULL, 665),
(21, '2019-02-20', 'Associate', 42, 'Production', '357', 'Bauni, Sreepur', 'Business', '', 'Poultry', 3, '1', '4', '24', '34', 1, 0, 0, 0, 0, '2019', '01/03/2019', 'Required for Research & Development Unit, Increase of New Flock', 'B.A', 'Strong communication, Good time management, Excellent researcher, Highly motivated, Proactive', 'Poultry Farm', '<p>01. Maintains a bio-security\r\nprogram on all farms.</p><p>01. Supervises contract broiler\r\ngrowers in the production of quality, cost-efficient broilers using approved\r\npoultry husbandry practices.</p><p>02.Checks progress of broiler grow-outon each flock and makes timely corrections as good poultry husbandry suggest.</p><p>03.Advises Broiler Manager as\r\nto broiler health issues and administers medications and vaccines prescribed by\r\nthe Corporate Veterinarian.</p><p>04.Manages the learning and\r\ntraining experience of contract broiler growers to continually improve the\r\nknowledge and skills in successful broiler grow out.</p><p>05.Pulls fat and blood samples\r\nfrom all flocks on a timely basis as required.</p><p>06.Must manage medications and\r\nassociated paperwork to provide timely and accurate inventories.</p><p>07.Performs other duties as\r\nrequired.</p><p>08.Recognizeand treat certain livestock health problems, trains new workers.</p>', 'Md. Hamim Uddin', '10', '<p>Two PositionReplacement Due To Resignation of Md. Al-Amin & Md. Sultan Mahmud</p>', 21, 18, '2019-03-28 07:40:06', '2019-02-10 23:56:16', 'Approved', NULL, 0, 1, 'Male', NULL, 665),
(23, '2019-02-20', 'Associate', 19, 'Production', '357', 'Haluaghat', 'Business', 'Poultry', 'Poultry', 5, '1', '4', '24', '34', 1, 0, 0, 0, 0, '2019', '01/03/2019', 'Seven Flock Increased, For Egg Store', 'B.A', 'Good time management, Strong communication, Ability to work under pressure,  Good initiative, Proactive', 'Breeder Farm', '<p>01. Assigns workers to duties, such as collecting\r\nand candling eggs, feeding and vaccinating poultry, cleaning and fumigating chicken houses.</p><p>02.Prepares worker attendance, egg production, feed consumption, and\r\npoultry mortality reports.</p><p>03. Vaccinations,ventilation &feed management.</p><p>04. Ensuring welfare of livestock.</p><p>05. Managing and motivating a team.</p><p>06.Assist and learn\r\nreporting requirements.</p><p>07.Maintains a bio-security\r\nprogram on all farms.</p><p>08.Controls cost in labor, repairs, supplies, and\r\nvaccines.</p><p>09.Performs other duties as\r\nrequired.</p><p>10.Promote safety\r\nthroughout assigned work area.</p>', 'Md. Huzzatul Islam', '10', '', 21, 18, '2019-03-28 07:40:06', '2019-02-11 07:22:50', 'Approved', NULL, 0, 1, 'Male', NULL, 665),
(24, '2019-02-20', 'Associate', 16, 'Production', '357', 'Memberbari, Gazipur', 'Business', '', 'Poultry', 5, '1', '4', '24', '34', 1, 0, 0, 0, 0, '2019', '01/03/2019', 'For Shed no 10 & 12, For future trained ', 'B.A', 'Good time management, Strong communication, Ability to work under pressure,  Good initiative, Proactive', 'Breeder Farm', '<p>01. Assigns workers to duties,\r\nsuch as collecting and candling eggs, feeding and vaccinating poultry, crating\r\nand shipping fryers, and cleaning and fumigating chicken houses.</p><p>02. Prepares worker\r\nattendance, egg production, feed consumption, and poultry mortality reports.</p><p>03.\r\nVaccinations, ventilation & feed management.</p><p>04. Ensuring welfare of\r\nlivestock.</p><p>05. Managing and motivating a\r\nteam.</p><p>06. Assist and learn\r\nreporting requirements.</p><p>07. Maintains a\r\nbio-security program on all farms. </p><p>08. Controls cost in\r\nlabor, repairs, supplies, and vaccines.</p><p>09. Performs other duties\r\nas required.</p><p>10. Promote safety\r\nthroughout assigned work area.</p>', 'Md. Khairuzzaman', '10', '', 21, 18, '2019-03-28 07:40:06', '2019-02-11 07:36:39', 'Approved', NULL, 0, 1, 'Male', NULL, 665),
(25, '2019-02-20', 'Associate', 16, 'Maintenance', '469', 'Membarbari, Gazipur', 'Business', '', 'Poultry', 2, '1', '4', '22', '34', 1, 0, 0, 0, 0, '2019', '01/03/2019', 'For every farm to have enough engineers, future trained engineer', 'Diploma (Electrical)', 'Good time management, Strong communication, Ability to work under pressure,  Good initiative, Proactive', 'Poultry Farm', '<p>01. Monitors\r\nall machinery and equipment in the facilities area to make sure that all\r\nparameters, pressures, temperatures, voltage, frequency, etc. are within\r\nrequires running condition.</p><p>02.Performs\r\nCorrective/Preventive Maintenance activities of all equipment in his specified\r\narea of responsibility. Troubleshoots electro-mechanical problems, which arises\r\nduring production in his designated area.</p><p>03.Effectively lead & support Site Safety Pillar Team,Must be able to thread\r\npipe.</p><p>04.Work with plant\r\nleadership to ensure all site safety programs are effectively implemented,\r\nrobust, and sustainable.</p><p>05.Communicate with\r\nproduction management and personnel to diagnose problems and to determine\r\npotential mechanical problems.</p><p>06.Identify parts or machines needing new or replacement parts.</p><p>07. Carry out routine maintenance work and respond to equipment faults.</p><p>08. Monitor and control maintenance costs.</p>', 'S.M. Mahmud Haider', '10', '', 21, 18, '2019-03-28 07:40:06', '2019-02-11 22:16:12', 'Approved', NULL, 0, 1, 'Male', NULL, 665),
(26, '2019-02-13', 'Associate', 32, 'Production', '356', 'Rangpur', 'Business', '', 'Feed', 1, '0', '0', '22', '26', 1, 0, 0, 0, 0, '2019', '01/03/2019', 'Due ', 'B.A(Pass)', 'Production Monitoring', 'Production', '<p>1. Daily Worker attendance,<br><br>2. Prepared daily production schedule.<br><br>3. All register maintain.<br><br>4. Monitoring and checking all activities of production,<br><br>5. Received all raw materials, Medicine and Finish goods.<br><br>6. Daily stock maintain.<br><br>7. Sending feed sample to lab.<br><br>8. Feed delivery,<br><br>9. Maintain warehouse, management and FIFO system of all raw materials and finish products.<br><br>10.Properly follow any decision of Higher management.<br><br>11. Co-operate to superior.</p>', 'Incharge (Md. Tarikuzzaman)', '2', '', 27, 18, '2019-03-28 07:40:06', '2019-02-13 05:10:29', 'Approved', NULL, 0, 1, 'Male', NULL, 665),
(27, '2019-02-17', 'Associate', 11, 'Maintenance', '655', 'Memberbari, Gazipur', 'Business', '', 'Feed', 3, '1', '4', '22', '35', 1, 0, 0, 0, 0, '2019', '16-03-2019', 'Reason For 03 Boiler Machine.', 'Certificate in Boiler (A/B Grade)', 'Good time management, Strong communication, Ability to work under pressure, Reason & Problem Solving, Physical Stamina, Mental Strength,', 'Poultry Feed Industry', '<p>1.Operate high pressure boilers, including\r\nstarting and shutting down.</p><p>2.Monitor boiler operations and react to varying\r\nload requirements.</p><p>3.Assure that various meter readings of pressure\r\nand temperature are recorded.</p><p>4.Inspect boiler pipes, valves, pumps, and safety\r\ndevices for leaks and malfunctions.</p><p>5.May be responsible for chemical makeup of water,\r\ntesting of water qualities, and checking viscosity of oil, and performing conductivity, alkalinity, phosphate,\r\nsilica, sulphate, and other hardness tests.</p><p>6.Prepare and maintain records on treatment, oil,\r\ngas chemicals consumption, and steam and hot water production.</p><p>7.Turns valves and adjusts\r\ncontrols to set specified fuel feed, draft openings, water level, and steam\r\npressure of boiler.</p>', 'Md. Rafiqul Islam', '5', '<p>At present we have 01 Boiler Operator. Thats why we have need 03 (01 is for Shifting) Boiler Operator. </p>', 22, 18, '2019-03-28 07:40:06', '2019-02-17 07:03:41', 'Approved', NULL, 0, 1, 'Male', NULL, 665),
(28, '2019-02-02', 'Associate', 13, 'Maintenance', '469', 'Mirsarai, Chittagong.', 'Business', 'Feed Mill', 'Feed', 1, '1', '3', '25', '30', 1, 0, 0, 0, 0, '2019', '15-02-2019', 'Floating Fish Feed Production Purpose.', 'Diploma Engineer (Mechanical)', 'Machine and Maintenance report create.', 'Mechanical', '<p>01. Overall Machine  Maintenance production purpose.</p><p>02. Production Related Panel Board Operating.</p><p>03. Ext-ruder Machine Operating.</p><p>04. Properly Maintenance Report Create.</p><p>05. Shifting duty. </p>', 'Mrinal Chakrobartty [In-Charge (Plant)]', '20', '', 24, 18, '2019-03-28 07:40:06', '2019-02-18 04:30:52', 'Approved', NULL, 0, 1, 'Male', NULL, 665),
(29, '2019-02-02', 'Associate', 13, 'Production', '347', 'Mirsarai, Chittagong.', 'Business', 'Feed Mill', 'Feed', 1, '0', '0', '24', '30', 1, 0, 0, 0, 0, '2019', '15-02-2019', 'Floating Fish Feed Production Purpose.', 'Graduate', 'Casual labor & worker maintenance.', 'Production', '<p>01. Feed production related work.</p><p>02. Properly Feed Delivery work.</p><p>03. Properly Raw Material Received.</p><p>04. Production related all register maintain.</p><p>05. Production Related all Report Create.</p>', 'Mrinal Chakrobartty [In-Charge (Plant)]', '50', '', 24, 18, '2019-03-28 07:40:06', '2019-02-18 04:49:59', 'Approved', NULL, 0, 1, 'Male', NULL, 665),
(30, '2019-02-02', 'Lead', 13, 'Maintenance', '655', 'Mirsarai, Chittagong.', 'Business', '', 'Feed', 1, '3', '5', '25', '32', 0, 1, 0, 0, 0, '2019', '15-02-2019', 'Project Unite 3 Floating Fish Feed Production Purpose new Boiler Machine installation.', 'Secondary School Certificate with  Boiler operator certificate holders approved by the government of Bangladesh.', 'Boiler Machine Maintenance.', 'Boiler Machine Operating.', '<p>01. Boiler Machine Operating & Maintenance.</p><p>02. Burner, Nozzle, Oil pump etc. Maintenance.</p><p>03. Daily Boiler Machine Register Book properly entry.</p><p>04. Boiler Machine & Boiler room always properly cleaning.</p><p>05. Boiler Machine any problem find-out & quickly inform to management.</p>', 'Mrinal Chakrobartty [In-Charge (Plant)]', '0', '', 24, 18, '2019-03-28 07:40:06', '2019-02-18 09:18:24', 'Approved', NULL, 0, 1, 'Male', NULL, 665),
(31, '2019-02-25', 'Associate', 17, 'Horticulture', '661', 'Memberbari, Gazipur', 'Business', '', 'Horticulture', 1, '1', '2', '25', '30', 0, 0, 1, 0, 0, '2019', '01-04-2019', 'Not additional position', 'Diploma (Agriculture)', 'Field Work', 'Agriculture', '<p>01.Handling Greenhouses & Related Crops</p><p>02.Soil Management for Agricultural Crop Production</p><p>03. Proper Fertilizer Calculation & Application</p><p>04.Disease & Pest Management</p><p>05.Analyzing Data & Making Reports</p>', 'Md. Shahinur Islam (Agriculture Officer)', '1', '<p>Due to recent termination of Mr. Sohel Rana as well as the beginning of two new Greenhouse Projects, one field supervisor, preferably with field work experience is required. </p>', 37, 18, '2019-03-28 07:40:06', '2019-02-25 01:45:37', 'Approved', NULL, 0, 1, 'Male', NULL, 665),
(32, '2019-02-25', 'Associate', 11, 'Production & QC', '347', 'Mamberbari, Gazipur.', 'Business', '', 'Feed', 2, '1', '3', '22', '35', 1, 0, 0, 0, 0, '2019', '16.03.2019', 'For increase Unit & Production', 'BA/B.Sc', 'Good time management, Strong communication, Ability to work under pressure, Reason & Problem Solving, Physical Stamina, Mental Strength,', 'Poultry Feed Industry', '<p>1.Contact\r\nwith Production Officer/Quality Control Officer to know about types and amount\r\nof feed to be produce as per sales strategy.</p><p>  2.Before\r\nstarting a shift be confirmed whether required amount of raw- materials and\r\npremixes have enough stock or not, discussing with Store Officer.</p><p>  3.Count\r\nnumber of workers to run a shift at the bagging and allot workers in\r\ndifferent points with their responsibilities.</p><p>  4.Discussing\r\nwith Engineer, prepare work plan for dumping raw materials as per batch/item.</p><p>  5.With the\r\nhelp of store/QC department, pursue FIFO (First in First Out) system in\r\nraw-materials and medicine usage.</p><p>  6.Committed\r\nto earn/achieve the goal of daily/monthly production target.</p><p>  7.At the end\r\nof a shift, handover responsibilities to the next Supervisor and provide\r\nbalance of raw materials and feeds stock to Store officer.</p><p>  8.Ensure\r\nloading of vehicle as per challan according to FIFO system.</p>', 'Md. Aminul Islam', '50', '', 22, 18, '2019-03-28 07:40:06', '2019-02-25 05:38:12', 'Approved', NULL, 0, 1, 'Male', NULL, 665),
(33, '2019-02-25', 'Associate', 11, 'Maintenance', '469', 'Mamberbari, Gazipur.', 'Business', '', 'Feed', 3, '1', '3', '20', '35', 0, 1, 0, 0, 0, '2019', '16.03.2019', 'Replacement Due to  Resignation & Transfer.', 'B.Sc / Diploma in Electrical, Electronics and Mechanical Engineering', 'Good time management, Effective technical skills, Ability to work under pressure, Problem-solving skills, Verbal and written communication skills, Cre', 'Poultry Feed Industry', '<p>01. Panel Board Operating.</p><p>02. Repair and maintenance\r\nof all electrical plants and auxiliary equipment to ensure plant maximum plant\r\navailability.</p><p>03. Provide daily and weekly progress reports on tasks assigned to the role.</p><p>04. Schedule routine maintenance and inspection of\r\nelectrical systems.</p><p>05. Ensure that system breakdowns, failures and\r\nrepairs are addressed promptly.</p><p>06. Sound knowledge in troubleshooting heating, air\r\nconditioning and refrigeration units.</p><p>07. Well-versed in installing and repairing pumps,\r\nmotors, fan coils and piping.</p><p>08. Knowledge in balancing air and water treatment\r\nsystems in accordance to HVAC protocols.</p><p>09. Knowledge about Poultry Feed Production System.</p><p>10. Works on Generator.</p>', 'Md. Rafiqul Islam', '50', '<p>1. Due to Resignation of Mr. Rajib Mia and Mr. Rakesh Tarapdar, Asst. Engineer</p><p>2. Due to Transfer of Mr. Abul Hashem, Asst. Engineer, DPCL.</p>', 22, 18, '2019-03-28 07:40:06', '2019-02-25 06:40:02', 'Approved', NULL, 0, 1, 'Male', NULL, 665),
(34, '2019-02-27', 'Associate', 41, 'Sales and Marketing', '419', 'Swarupkathi Lab', 'Corporate', 'Corporate', 'Feed', 1, '0', '2', '25', '30', 0, 1, 0, 0, 0, '2019', '15 to 20 days.', 'Forcefull resignation', 'DVM (Microbiology)', 'Lab test experience will be prefered', 'Technical', '<p>1. Provide laboratory test support to the customers.</p><p>2. Conduct different serological tests</p><p>3. Provide field support in the Swarupkathi field.</p><p>4. Weekly reporting about the lab activity and field farm visit.</p><p>5. Any other work assigned by the supervisor.</p>', 'Dr. Nawroj Mehedi', '1', '<p>This requisition has been raised by forcefully demanded resignation due to unsatisfactory performance by the employee. </p>', 34, 18, '2019-03-28 07:40:06', '2019-02-27 00:54:01', 'Approved', NULL, 0, 1, 'Male', NULL, 665),
(35, '2019-02-27', 'Associate', 41, 'Sales and Marketing', '419', 'lalmohon, Shirajganj', 'Corporate', 'Corporate', 'Feed', 2, '0', '2', '25', '30', 1, 0, 0, 0, 0, '2019', '15 to 20 days.', 'To provide extensive support to the customers of South Zone', 'DVM', 'Treatment and Farm management', 'Technical support', '<ol>\r\n<li>Provide technical support and services to the\r\n     farmers and dealers in his area/zone.</li><li>Guide the farmers about updated farm management\r\n     systems.</li><li>Collect market data of the competitors\r\n     information and will send to the supervisor.</li><li>Keep the sales target information of the zone or\r\n     area and will work according to plan.</li><li>Provide technical services to improve sales and\r\n     will help to achieve the target of the MOs and zone incharge and weekly reporting to head office supervisor.</li></ol>', 'Dr. Nawroj Mehedi', '1', '', 34, 18, '2019-03-28 07:40:06', '2019-02-27 01:00:15', 'Approved', NULL, 0, 1, 'Male', NULL, 665),
