(51, '2019-04-07', 'Associate', 42, 'Sales', '396', 'Bauni, Sreepur', 'Business', '', 'Poultry', 1, '1', '3', '24', '36', 0, 1, 0, 0, 0, '2019', '16/04/2019', 'Replacement Due To Resignation - Rafijur Khandakar', 'B-Com/BBA', 'Good time management, Strong communication, Ability to work under pressure,  Good initiative, Proactive', 'Poultry Farm', '<p>1.Maintain Booking,\r\nDelivery & Money receipt.</p><p>2.Good Transport\r\nDistribution.</p><p>3.Answers questions from\r\ncustomers about product benefits.</p><p>4.Maintains excellent\r\nrelationship with customers through superior customer service.</p><p>5.Analyses trends, data,\r\ndemographics, pricing strategies, and other information that can potentially\r\nimprove marketing and sales performance.</p><p>6.Develop sales\r\nstrategies for our farm.</p><p>7.Implements and adheres\r\nto company policies and procedures.</p><p>8.Other duties as\r\nassigned.</p><p><strong></strong></p>', 'Md. Hamim Uddin', '10', '', 21, 18, '2019-04-27 05:46:07', '2019-04-07 10:02:52', 'Approved', NULL, 0, 1, 'Male', NULL, 665),
(52, '2019-04-09', 'Associate', 25, 'Production', '357', 'Ghatail, Tangail', 'Business', '', 'Poultry', 2, '1', '3', '22', '34', 1, 0, 0, 0, 0, '2019', '16/04/2019', ' Flock Increased', 'B.A', 'Good time management, Strong communication, Ability to work under pressure,  Good initiative, Proactive', 'Poultry Farm', '<ol><li>Flock management.</li><li>Feeding observation.</li><li>Vaccination monitoring.</li><li>House cleaning</li><li>Bio-security maintain.</li><li>Ensuring welfare of livestock.</li><li>Prepares worker\r\nattendance, egg production, feed consumption, and poultry mortality reports.</li></ol>', 'Dr. Aminul Islam', '10', '', 21, 18, '2019-04-27 05:46:07', '2019-04-09 03:44:35', 'Approved', NULL, 0, 1, 'Male', NULL, 665),
(53, '2019-04-09', 'Associate', 17, 'Horticulture', '670', 'Memberbari, Gazipur', 'Business', '', 'Horticulture', 1, '1', '3', '25', '35', 1, 0, 0, 0, 0, '2019', '15-04-2019', 'Development of Two New Greenhouse Projects ', 'SSC', 'Field Work', 'Agriculture', '<p>1. Hands on experience on agricultural crop management</p><p>2. Application of fertilizer on crops</p><p>3. Application of pesticides on crops</p><p>4. Irrigation management</p><p>5. Greenhouse management</p>', 'Md. Shahinur Islam (Agriculture Officer)', '1', '<p>Additional position is required due to development of two new greenhouse projects.</p>', 37, 18, '2019-04-27 05:46:07', '2019-04-09 06:21:49', 'Approved', NULL, 0, 1, 'Male', NULL, 665),
(54, '2019-04-10', 'Associate', 32, 'Mechanical', '663', 'Rangpur', 'Business', '', 'Poultry', 1, '0', '0', '20', '25', 1, 0, 0, 0, 0, '2019', '01/05/2019', 'due', 'Diploma in Mechanical', 'Mechanical', 'Maintenence', '<p>1. Panel Board operation<br>2. Generator<br>3. Machine Maintenance<br>4. Pellet Mill Operating<br>6. Roller fitting<br>7. Dies Fitting<br>8. P.L.C Operation<br>9. Production Running<br>10. Boiler operation<br>11. Compresor operating.</p>', 'Md. Tarikuzzaman (Incharge)', '2', '', 27, 18, '2019-04-27 05:46:07', '2019-04-10 02:23:47', 'Approved', NULL, 0, 1, 'Male', NULL, 665),
(55, '2019-04-20', 'Associate', 14, 'Production', '347', 'Baniargati, Bosundia, Jessore.', 'Business', '', 'Feed', 2, '1', '3', '23', '30', 1, 0, 0, 0, 0, '2019', '01/05/2019', 'For Proper monitoring', 'Graduate', 'Casual labor & worker maintenance.', 'Good managing mantality, Active, Done job under Pressure, Maintain officeal decorum, Must have creat', '<p>1. Manage & control production floor and worker during production and maintain related register.</p><p>2. Strongly ensure the proper way of pre-mix & oil/liquid molasses weight, dumping and batch mixer/mini-mixing timing.</p><p>3. Implement all the rules of quality assurance dumping to finish product packing & maintain bin cards.</p><p>4. Maintain key rules of FIFO systems terms of raw materials consumption & finish feed delivery,strongly maintain & record the batch wise manual dumping.</p><p>5. Supervise unloading Qualified raw materials load finish goods with good manners as per office instruction.</p><p>6. Reporting superior time to time & done job as office rules.</p>', 'Md. Golam Rabbani , Engineer (Plant)', '30', '', 26, 18, '2019-04-27 05:46:07', '2019-04-20 07:17:07', 'Approved', NULL, 0, 1, 'Male', NULL, 665),
(56, '2019-04-21', 'Associate', 30, 'Production', '658', 'P & FP (Factory)', 'Business', '', 'Consumer Food', 1, '1', '2', '20', '30', 1, 0, 0, 0, 0, '2019', '01/05/2019', 'Online QC Purpose', 'SSC and HSC on Science background', 'On QC Area', 'Full Time', '<ul><li>-Taking samples on regular basis by the\r\ninstruction of Microbiologist</li><li>-Perform quality control activities on production\r\nfloor as per requirement </li><li>-Cleaninglaboratory and equipments regular basis</li></ul>', 'Assistant Officer (Microbiology)', '0', '', 33, 18, '2019-04-27 05:46:07', '2019-04-21 05:21:19', 'Approved', NULL, 0, 1, 'Male', NULL, 665),
(57, '2019-04-21', 'Process Owner', 30, 'Production', '535', 'P & FP (Factory)', 'Business', '', 'Consumer Food', 1, '1', '2', '25', '30', 0, 1, 0, 0, 0, '2019', '01/05/2019', 'Replacement for Dr. Bijoy Mollik', 'DVM with MS in Microbiology', 'Microbiology  /Diagnostic', 'Full Time', '<ul><li>Taking samples on regular basis for in house and\r\nexternal test</li><li>Performing laboratory tests as per requirement </li><li>Reporting the test results regularly to the\r\nsuperiors </li><li>Taking immediate corrective action if any non-compliance found in test results</li><li>Total management of laboratory equipments</li><li>Perform quality control activities on production\r\nfloor as per requirement </li><li>Prepare laboratory and QC related documents for\r\naudit purpose</li><li>Performing Ante-mortem and Post-mortem\r\ninspection of birds on regular basis to ensure disease free safe poultry meat</li><li>Facing Audits (ISO, HACCP, GMP, HALAL, Yum!\r\nBrand)</li></ul>', 'Officer (Microbiology)', '1', '', 33, 18, '2019-04-27 05:46:07', '2019-04-21 06:05:01', 'Approved', NULL, 0, 1, 'Male', NULL, 665),
(58, '2019-04-24', 'Associate', 37, 'Production', '347', 'Paragon Plastic limited (FIBC), Gazipur', 'Business', '', 'Plastic', 1, '5', '10', '22', '29', 1, 0, 0, 0, 0, '2019', '02.05.2019', 'New Project', 'H.S.C/Diploma (Electrical, Mechanical)', 'Plan, manage and assign work, Production Supervision According to Production order, , Capable Of good maintain poerator and helper, keeping production', 'Supervision loom, Tape plan Production.', '<p>1. Prepare production schedule.</p><p>2. Assist in production when needed.</p><p>3. Make sure employees are following, keep their area clean all times, and tools production.</p><p>4. Keep in production register.</p><p>5. Follow production order etc.</p>', 'Mr.Abul Hasnat', '20', '', 39, 18, '2019-04-27 05:46:07', '2019-04-24 10:15:51', 'Approved', NULL, 0, 1, 'Male', NULL, 665),
